def how_many_pizzas(n):
    area_8 = 8 * 8 * 3.14159265359
    area_n = n * n * 3.14159265359
    whole_pizzas = int(area_n // area_8)
    remaining_slices = int((area_n % area_8) / (8 * 8 * 3.14159265359) * 8)
    return "pizzas: {}, slices: {}".format(whole_pizzas, remaining_slices)

def how_many_pizzas(n):
    pizza_size = 8 ** 2 * 3.14159
    total_slices = n ** 2 * 3.14159
    full_pizzas = int(total_slices // pizza_size)
    remaining_slices = round(total_slices % pizza_size / (8 ** 2 * 3.14159) * 8)
    return "pizzas: {}, slices: {}".format(full_pizzas, remaining_slices)
